class Solution:
    def minimumOperations(self, nums: List[int], target: List[int]) -> int:
        last = 0
        ans = 0
        for i in range(len(nums)):
            nums[i]-=target[i]
        for n in nums:
            if n>last:
                ans+=n-last
            last=n
        if last<0:
            ans+=-last
        return ans
